import React from 'react'
import {Link } from 'react-router-dom'

import {Container} from './style'

import logo from '../../assets/image/logo.svg'

export default function Headers() {
    return (
        <Container>
            <Link to='/'>
                <img src={logo} alt='RocketShoes'/>
            </Link>
        </Container>
    )
}
